package com.flink.platform.dao;

import com.flink.platform.common.enums.ExecutionStatus;
import com.flink.platform.common.util.JsonUtil;
import com.flink.platform.dao.entity.JobInfo;
import com.flink.platform.dao.entity.JobRunInfo;
import com.flink.platform.dao.entity.LongArrayList;
import com.flink.platform.dao.entity.result.JobCallback;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

/** Unit test for simple App. */
class MapperInitializerTest {
    /** Rigorous Test :-). */
    @Test
    void shouldAnswerWithTrue() {
        LongArrayList longs = new LongArrayList();
        longs.add(1L);
        longs.add(2L);

        JobInfo jobInfo = new JobInfo();
        jobInfo.setId(3L);
        jobInfo.setRouteUrl(longs);

        String str = JsonUtil.toJsonString(jobInfo);
        JobInfo newJob = JsonUtil.toBean(str, JobInfo.class);
        assertEquals(jobInfo, newJob);
    }

    @Test
    void callback() {
        JobRunInfo jobRunInfo = new JobRunInfo();
        JobCallback jobCallback = new JobCallback();
        jobCallback.setJobId("job_id");
        jobCallback.setAppId("app_id");
        jobCallback.setTrackingUrl("http://test");
        jobCallback.setExited(false);
        jobCallback.setProcessId(11L);
        jobCallback.setStatus(ExecutionStatus.SUCCESS);
        jobCallback.setMessage(
                ""
                        + "");
        jobCallback.setErrMsg(
                ""
                        + "");

        var message =
                ""
                        + ""
                        + ""
                        + "";
        jobCallback.setStdMsg(message);

        System.out.println("error: " + jobCallback.getErrMsg().length());
        System.out.println("msg: " + jobCallback.getMessage().length());
        System.out.println("std: " + jobCallback.getStdMsg().length());

        jobRunInfo.setBackInfo(jobCallback);
        JobCallback back = jobRunInfo.getBackInfo();
        String jsonString = JsonUtil.toJsonString(back);
        System.out.println(jsonString.length());
    }
}
